import { CLICK_SKILL } from '../actions/types';

const clickSkillReducer = (state = [], action) => {
  switch(action.type) {
    case 'FETCH_POSTS':
      return action.payload;
    default:
      return state;
  }
}

export default clickSkillReducer;
